import React, {Component} from 'react';

class AutoComplete extends Component{

    constructor(props){
        super(props);
        this.items=[
            'London',
            "Paris",
            "Budapest",
            "BUD",
            "AMS",
            "Amsterdam",
            "Prague",
            "Pula"
        ];
    }


    render(){
        return(
            <div>
                <input type="text" placeholder={this.props.placeholder}/>
                <ul>
                    {this.items.map((item) => <li>{item}</li>)}
                </ul>
            </div>
        )
    }

}

export default AutoComplete;
